function tooltip(selector) {

  var iOS = !!navigator.platform && /iPad|iPhone|iPod/.test(navigator.platform);
  if(iOS){
    return;
  }

  var titles;
  switch (typeof selector) {
    case 'object':
      titles = selector.find('[title]');
      break;
    case 'string':
      selector = $(selector);
      titles = selector.find('[title]');
      break;
    default: // undefined
      titles = $('[title]');
      break;
  }

  if (titles.length) {
    if ( 'ontouchstart' in document.documentElement ) {
      titles = titles.not('a[href]');
      titles.each(function(){
        var el = $(this);
        var events = el.data('events');
        if ( typeof(events) == 'undefined' && !el.attr('onclick') && !el.attr('mousedown') ) {
          el.tooltip({
            track: true,
            position: {
              my: 'center top+20',
              at: 'center top-20',
              using: function( position, feedback ) {
                $( this ).css( position );
                $( '<div>' )
                  .addClass( 'arrow' )
                  .addClass( feedback.vertical )
                  .addClass( feedback.horizontal )
                  .appendTo( this );
                $( '<div>' )
                  .addClass( 'close' )
                  .attr('onclick', '$([aria-describedby="$(this).closest(\'[role="tooltip"]\').attr(\'id\')"]).tooltip( \'close\');')
                  .appendTo( this );
              }
            }
          });
        }
      });
    } else {
      titles.tooltip({
        track: true,
        position: {
          my: 'center top+20',
          at: 'center top-20',
          using: function( position, feedback ) {
            $( this ).css( position );
            $( '<div>' )
              .addClass( 'arrow' )
              .addClass( feedback.vertical )
              .addClass( feedback.horizontal )
              .appendTo( this );
          }
        }
      });
    }
  }
}

// ]]>
