    var datetoBtn = this.getDateTo();
    var datebackBtn = this.getDateBack();

    if ( cntOpened ) {
      switch (current_day) {
        case 0:
          this.positionCalendar(datetoBtn);
          datebackBtn.removeClass('active');
          datetoBtn.addClass('active');
