function getDayId(index) {
  var id;
  index = parseInt(index);
  if ( typeof(index) == 'undefined' ) return;
  if (index < 10) {
    id = '#day_00';
  }
  if (index >= 10 && index < 100) {
    id = '#day_0';
  }
  if (index >= 100) {
    id = '#day_';
  }
  if ( typeof(id) == 'undefined' ) return;
  id = id.concat(index);

  return id;
}


