function onBasketUpdate(){

  $("#form_dateto").trigger('click');
  var date_to_index = date_format;
  date_to_index = date_to_index.replace( "dd", basket_date_to.dd );
  date_to_index = date_to_index.replace( "mm", basket_date_to.mm );
  date_to_index = date_to_index.replace( "yyyy", basket_date_to.yyyy );
  date_to_index = date_to_index.replace( "yy", basket_date_to.yyyy );
  var day_to = horizontal_monthly_calendar.getDayByDate( date_to_index );
  $( day_to ).trigger('click');

  if ( typeof( basket_date_back ) !== "undefined" ) {
    $("#form_dateback").trigger('click');
    var date_back_index = date_format;
    date_back_index = date_back_index.replace( "dd", basket_date_back.dd );
    date_back_index = date_back_index.replace( "mm", basket_date_back.mm );
    date_back_index = date_back_index.replace( "yyyy", basket_date_back.yyyy );
    date_back_index = date_back_index.replace( "yy", basket_date_back.yyyy );
    var day_back = horizontal_monthly_calendar.getDayByDate( date_back_index );
    $( day_back ).trigger('click');
  }

  topForm.update();
}

function set_onsubmit_handlers() {
  var _depart, _arrival;

  ibe_ajax.extend('on_before_post', function() {
    if ($('#depart').prop('tagName') !== 'SELECT') {
      var depart, arrival;
      _depart = depart = $('#depart').val();
      _arrival = arrival = $('#arrival').val();

      var depart_text = $('.j-point-info[data-point-type="depart"] .j-point-code') && $('.j-point-info[data-point-type="depart"] .j-point-code').text()!="" ? depart+' ('+$('.j-point-info[data-point-type="depart"] .j-point-code').text()+')' : depart;
      var arrival_text = $('.j-point-info[data-point-type="arrival"] .j-point-code') && $('.j-point-info[data-point-type="arrival"] .j-point-code').text()!="" ? arrival+' ('+$('.j-point-info[data-point-type="arrival"] .j-point-code').text()+')' : arrival;

      $('#depart').val(depart_text);
      $('#arrival').val(arrival_text);
    }
    topForm.update();
  });

  ibe_ajax.extend('on_after_post', function() {
    if ($('#depart').prop('tagName') !== 'SELECT') {
      $('#depart').val(_depart);
      $('#arrival').val(_arrival);
    }
  });
} // custom_form_order_on_submit

