};

HorizontalMontlhyCalendar.prototype = {
// ÃÃªÃ°Ã®Ã«Ã«Ã¨Ã­Ã£ Ã¢Ã«Ã¥Ã¢Ã®
  'scrollLeft': function() {
    var newPos = this.viewportPos - this.viewportSize;
    this.scrollToPosition(newPos);
  },

  'deselectDays' : function() {
    calendar.hide();
  },

  'selectDays' : function() {
    for (var ind in selected_days) {
      if (selected_days[ind]) {
        $(selected_days[ind]).addClass('selected_' + ind);
      }
    }
  },

  // ÃÃªÃ°Ã®Ã«Ã«Ã¨Ã­Ã£ Ã¢Ã¯Ã°Ã Ã¢Ã®
  'scrollRight': function() {
    var newPos = this.viewportPos + this.viewportSize;
    this.scrollToPosition(newPos);
  },

  // ÃÃ°Ã®Ã¢Ã¥Ã°ÃªÃ  Ã¯Ã®Ã§Ã¨Ã¶Ã¨Ã¨
  'checkPosition': function(newPos) {
    if (newPos > this.maxViewportPos) {
      newPos = this.maxViewportPos;
    }

    if (newPos < 0) {
      newPos = 0;
    }

    return newPos;
  },

  // ÃÃ°Ã®Ã¢Ã¥Ã°ÃªÃ  Ã¯Ã®Ã§Ã¨Ã¶Ã¨Ã¨
  'checkVisible': function(newPos) {
    var visible = false;

    if (newPos >= this.viewportPos && newPos < this.viewportPos + this.viewportSize) {
      visible = true;
    }

    return visible;
  },

  // ÃÃªÃ°Ã®Ã«Ã«Ã¨Ã­Ã£ Ã¤Ã® Ã¯Ã®Ã§Ã¨Ã¶Ã¨Ã¨
  'scrollToPosition': function(newPos, animate) {
    var value;
    newPos = this.checkPosition(newPos);

    if (0 == newPos - this.viewportPos) {
      value = false;
    }
    else {
      value = true;
    }

    if (value) {
      this.viewportPos = newPos;
    }

    if (value && false !== animate) {
      var browser = $.browser;
      animate = !(browser.msie && parseInt(browser.version, 10) <= 8);
    }

    if (value && animate) {
      $(this.scroll_selector).animate({
        'left': (-newPos * this.cellWidth).toString().concat('px')
      }, this.scrollingDuration, 'swing');
    }

    if (value && !animate) {
      $(this.scroll_selector).css('left', (-newPos * this.cellWidth).toString().concat('px'));
    }

    if (value) {
      this.navigationUpdate();
    }
  },

  // ÃÃ¡Ã­Ã®Ã¢Ã«Ã¥Ã­Ã¨Ã¥ Ã±Ã²Ã°Ã Ã­Ã¨Ã¶Ã» Ã¯Ã® Ã±Ã¬Ã¥Ã¹Ã¥Ã­Ã¨Ã¾
  'positionUpdate': function(left) {
    this.viewportPos = this.checkPosition(Math.floor(-left / this.cellWidth));
    this.navigationUpdate();
  },

  // ÃÃ¡Ã­Ã®Ã¢Ã«Ã¥Ã­Ã¨Ã¥ Ã½Ã«Ã¥Ã¬Ã¥Ã­Ã²Ã®Ã¢ Ã­Ã Ã¢Ã¨Ã£Ã Ã¶Ã¨Ã¨
  'navigationUpdate': function() {
    this.curPage = Math.ceil(this.viewportPos / this.viewportSize);

    // ÃÃªÃ²Ã¨Ã¢Ã Ã¶Ã¨Ã¿/Ã¤Ã¥Ã ÃªÃ²Ã¨Ã¢Ã Ã¶Ã¨Ã¿ Ã«Ã¥Ã¢Ã®Ã£Ã® Ã±Ã«Ã Ã©Ã¤Ã¥Ã°Ã 
    var self = this;
    if (this.curPage > 0) {
      $('#hmc_slider_left').addClass('active').unbind('click').bind('click', function() {
        self.scrollLeft();
      });
    } else {
      $('#hmc_slider_left.active').removeClass('active').unbind('click');
    }

    // ÃÃªÃ²Ã¨Ã¢Ã Ã¶Ã¨Ã¿/Ã¤Ã¥Ã ÃªÃ²Ã¨Ã¢Ã Ã¶Ã¨Ã¿ Ã¯Ã°Ã Ã¢Ã®Ã£Ã® Ã±Ã«Ã Ã©Ã¤Ã¥Ã°Ã 
    if (this.viewportPos < this.maxViewportPos) {
      $('#hmc_slider_right').addClass('active').unbind('click').bind('click', function() {
        self.scrollRight();
      });
    } else {
      $('#hmc_slider_right.active').removeClass('active').unbind('click');
    }
  },

  'setDateTo': function(date_to) {
    this.date_to = date_to;
  },

  'setDateBack': function(date_back) {
    this.date_back = date_back;
  },

  'getDateTo': function() {
    return this.date_to ? this.date_to : $('#form_dateto');
  },

  'getDateBack': function() {
    return this.date_back ? this.date_back : $('#form_dateback');
  },

  'setDepartureDate': function(day_index, id) {
    var day = days_list[id];
    switch (day_index.toString()) {
      case '0':
        $(this.getDateTo()).html(day.view);
        var multi_d_to = $(this.getDateTo()).closest('.' + FO.route).find('input[name="multi_dateto[]"]');
        if (multi_d_to.length) {
          $(multi_d_to).val(day.date);
        } else {
          $('#dateto').val(day.date);
        }
        break;

      case '1':
        $(this.getDateBack()).html(day.view)
        $('#dateback').val(day.date);
        break;
    }
  },

  // ÃÃ±Ã²Ã Ã­Ã®Ã¢ÃªÃ  ÃªÃ Ã«Ã¥Ã­Ã¤Ã Ã°Ã¿ Ã­Ã  Ã³ÃªÃ Ã§Ã Ã­Ã­Ã³Ã¾ Ã¤Ã Ã²Ã³
  'setToDate': function (day, animate) {
    current_day = day;

    if (null === animate) {
      animate = true;
    }

    if (selected_days.hasOwnProperty(day)
      && false !== selected_days[day]
      && days_list.hasOwnProperty(selected_days[day])
      && !this.checkVisible(days_list[selected_days[day]].month)
    ) {
      this.scrollToPosition(days_list[selected_days[day]].month, animate);
    }
  },

  // ÃÃ±Ã²Ã Ã­Ã®Ã¢ÃªÃ  Ã¯Ã¥Ã°Ã¥Ã«Â¸Ã²Ã®Ã¢
  'setMultiRouteFlights': function (points, classname) {
    var route = points.join('\\A ');
    $('head').append('<style type="text/css">#ts_ag_reservation .calendar_container .' + classname + ':after { content: "' + route + '"; } </style>');
  },

  // ÃÃ¡Ã­Ã®Ã¢Ã«Ã¥Ã­Ã¨Ã¥ Ã¯Ã¥Ã°Ã¥Ã«Â¸Ã²Ã®Ã¢
  'updateFlights': function () {
    var prev_day = false;
    var legs = [];
    var points = [];
    var code;
    if(typeof(formOrder) !== 'undefined' && formOrder.form.find('.' + FO.routeType + ':checked').first().val()=='OW'){
      _selected_days = selected_days;
    }
    for (var index in point_codes) {
      if (point_codes.hasOwnProperty(index)) {
        code = point_codes[index];
        points.push(code);

        if (selected_days.hasOwnProperty(index)) {
          if (0 == legs.length || false != selected_days[index] && selected_days[index] == prev_day) {
            legs.push(index);
          }

          if (points.length > 1 && (false == selected_days[index] || selected_days[index] != prev_day)) {
            legs = [index];
            points = [code];
          }

          prev_day = selected_days[index];
        }
      }
    }

    points.push(point_codes[0]);
  },

  'switch': function(cntOpened) {
    if ( typeof(cntOpened) == 'undefied' ) {
      cntOpened = true;
    }
    var datetoBtn = this.getDateTo();
    var datebackBtn = this.getDateBack();

    if ( cntOpened ) {
      switch (current_day) {
        case 0:
          this.positionCalendar(datetoBtn);
          datebackBtn.removeClass('active');
          datetoBtn.addClass('active');
          break;

        case 1:
          this.positionCalendar(datebackBtn);
          datebackBtn.addClass('active');
          datetoBtn.removeClass('active');
          break;
      }
    }
  },

  // ÃÃ®Ã§Ã¨Ã¶Ã¨Ã®Ã­Ã¨Ã°Ã®Ã¢Ã Ã­Ã¨Ã¥ ÃªÃ Ã«Ã¥Ã­Ã¤Ã Ã°Ã¿ Ã¯Ã®Ã¤ Ã²Ã¥ÃªÃ³Ã¹Ã¥Ã© Ã¤Ã Ã²Ã®Ã©
  'positionCalendar': function(dateBtn) {
