function onCalendarCellClick(cell) {
  if ( typeof(cell) == 'undefined' || !cell.length ) return;

  var process = false;
  var id;

  if (cell.length > 0) {
    id = '#'.concat(cell.attr('id'));
  }

  if (cell.length > 0 && (process = (selected_days[current_day] !== id))) {
    var prev_cell;

    var prev_selected_days, class_name;

    if (isMultiRoute()) {
      var fieldset = multiroute.getActiveRoute();
      var route_number = $(fieldset).data('route-number');

      prev_selected_days = getDayId(calendar.getDate(route_number));
      class_name = 'selected_multi';

      calendar.hideRoute(route_number);
    } else {
      prev_selected_days = selected_days.slice(0);
      class_name = 'selected_'.concat(current_day);
    }

    if (!isMultiRoute() && false !== selected_days[current_day]) {
      prev_cell = $(selected_days[current_day]);
      prev_cell.removeClass(class_name);
    }

    if (isMultiRoute()) {
      calendar.setDate(route_number, id.substr(-3));
    } else {
      selected_days[current_day] = id;
    }
    cell.addClass(class_name);
    horizontal_monthly_calendar.setDepartureDate(current_day, id);

    var sorted = [];
    var day = 0;
    var day_no;
    current_day_no = parseInt(id.substr(5), 10);
    while (day < selected_days.length && day < max_legs && false !== selected_days[day]) {
      day_no = parseInt(selected_days[day].substr(5), 10);
      sorted[day] = selected_days[day];
      if (day < current_day && day_no > current_day_no) {
        sorted[day] = selected_days[current_day];
      }
      if (day > current_day && day_no < current_day_no) {
        sorted[day] = selected_days[current_day];
      }
      day++;
    }
  }

  if (process) {
    var day = 0;

    for (day = 0; day < sorted.length; day++) {
      class_name = 'selected_'.concat(day);
      if (selected_days[day] != sorted[day]) {
        $(selected_days[day]).removeClass(class_name);
        selected_days[day] = sorted[day];
        cell = $(selected_days[day]);
        cell.addClass(class_name);
        horizontal_monthly_calendar.setDepartureDate(day, selected_days[day]);
      }
    }

    var last_index = selected_days.length - 1;
    var begin = false;
    var end = false;
    var index;

    if (false !== selected_days[0]) {
      begin = parseInt(selected_days[0].substr(5), 10);
    }
    if (false !== selected_days[last_index]) {
      end = parseInt(selected_days[last_index].substr(5), 10);
    }

    if (false !== begin && false !== end && false !== prev_selected_days[last_index]) {
      var prev_begin = parseInt(prev_selected_days[0].substr(5), 10);
      var prev_end = parseInt(prev_selected_days[last_index].substr(5), 10);

      // Highlight the period
      for (index = begin; index < prev_begin; index++) {
        $(getDayId(index)).addClass('period');
      }
      for (index = prev_end + 1; index <= end; index++) {
        $(getDayId(index)).addClass('period');
      }

      // Remove previous period
      for (index = prev_begin; index < begin; index++) {
        $(getDayId(index)).removeClass('period');
      }
      for (index = end + 1; index <= prev_end; index++) {
        $(getDayId(index)).removeClass('period');
      }
    }

    if (false !== begin && false !== end && false === prev_selected_days[last_index]) {
      for (index = begin; index <= end; index++) {
        $(getDayId(index)).addClass('period');
      }
    }
  }

  if (process && 1 == current_day) {
    prev_day_1 = selected_days[1];
  }

  if (process) {
    var update = false;
    var day;

    var diff_selected = {};
    for (var index in selected_days) {
      if (selected_days.hasOwnProperty(index) && false != (day = selected_days[index])) {
        diff_selected[day] = diff_selected.hasOwnProperty(day) ? (diff_selected[day] + 1) : 1;
      }
    }

    var diff_prev = {};
    for (var index in prev_selected_days) {
      if (prev_selected_days.hasOwnProperty(index) && false != (day = prev_selected_days[index])) {
        diff_prev[day] = diff_prev.hasOwnProperty(day) ? (diff_prev[day] + 1) : 1;
      }
    }

    if (GetPropertiesCount(diff_prev) != GetPropertiesCount(diff_selected)) {
      update = true;
    }
    else {
      var values = [];
      for (var key in diff_prev) {
        if (diff_prev.hasOwnProperty(key)) {
          values.push(diff_prev[key]);
        }
      }

      var index = 0;
      for (var key in diff_selected) {
        if (diff_selected.hasOwnProperty(key) && diff_selected[key] != values[index]) {
          update = true;
          break;
        }

        index++;
      }
    }

    if (max_legs > 1) {
      $(horizontal_monthly_calendar.getDateTo()).removeClass('active');
      $(horizontal_monthly_calendar.getDateBack()).removeClass('active');

      horizontal_monthly_calendar.deactivateDaysBefore( selected_days[current_day] );
      current_day++;
      if (max_legs <= current_day) {
        current_day = 0;
        horizontal_monthly_calendar.resetDeactivatedDays();
      }

      switch (current_day) {
        case 0:
          if ( calendar.isCalendarOpened() ) {
            calendar.closeCalendar();
          }
          var d_to = horizontal_monthly_calendar.getDateTo();
          //$(d_to).addClass('active');
          horizontal_monthly_calendar.positionCalendar(d_to);
          break;

        case 1:
          var d_back = horizontal_monthly_calendar.getDateBack();
          //$(d_back).addClass('active');
          horizontal_monthly_calendar.positionCalendar(d_back);
          break;
      }
    } else {
      $(horizontal_monthly_calendar.getDateTo()).removeClass('active');
      if ( isMultiRoute() ) {
        // TODO: open next calendar (?)
      }
      calendar.closeCalendar();
    }
    if (update) {
      horizontal_monthly_calendar.updateFlights();
    }
  }

  if ( isMultiRoute() ) calendar.render();
}

