function positionBlock(block){
  if ( typeof(block) == 'undefined' ) {
    return;
  } else if ( typeof(block) == 'string' ) {
    block = $(block);
  }

  if ( block.css('display') !== 'none' ) {
    block.css('display', 'flex');
  }

  var height = false;
  block.css({'height': '150px'});

  var body = document.body;
  var html = document.documentElement;
  var systemFooter = $('#system_footer').is(':visible') ? $('#system_footer').outerHeight() : 0;

  var docHeight = Math.max( body.scrollHeight, body.offsetHeight, html.clientHeight, html.scrollHeight, html.offsetHeight );
  var blockHeight = block.outerHeight() + systemFooter;
  if ( blockHeight < docHeight ) {
    var footerHeight = $('#footer').is(':visible') ? $('#footer').outerHeight() : 0;
    var blockOffsetTop = block.offset().top;
    height = docHeight - blockOffsetTop - footerHeight - systemFooter - 20;
    block.css({'height':height + 'px'});

    $('#ts_ag_reservation .ts-searchform-wrap').show();
  }
}

