function stickyBars(){
    var scrollTop = $(window).scrollTop();
    $('.direction').each(function(index){
        var parentContainer = $(this);
        parentContainer.find('.'+stickClass).each(function(index){

        if(($(this).offset().top - $(this).data('offset') < scrollTop && parentContainer.offset().top + parentContainer.outerHeight() > scrollTop) && !$(this).data('stik')){
          var top = $(this).data('offset');
          $(this).clone().insertAfter($(this)).addClass(stickedClass).css({'top':top+'px'}).find('.sf-stick__background').css({'top':top+'px'});
          $(this).data('stik',true);
        }

        if($(this).offset().top - $(this).data('offset') > scrollTop || (parentContainer.offset().top + parentContainer.outerHeight() - $(this).outerHeight() - $(this).data('offset') < scrollTop && !$(this).data('fixed')) && $(this).data('stik')){
           $(this).next('.'+stickedClass).remove();
           $(this).data('stik',false);
         }

         $(this).css({'width':parentContainer.outerWidth()+'px'});
        });
    });
}

function resetStickyBars() {
